  <div>
    <h3 class="text-2xl text-left py-2">User List</h3>
    <div class="overflow-x-auto relative sm-rounded-lg">
      <table class="w-full text-left text-gray-500 dark:text-gray-400">
        <thead class="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
          <tr>
            <th scope="col" class="py-3 px-6">ID</th>
            <th scope="col" class="py-3 px-6">User</th>
            <th scope="col" class="py-3 px-6">Date of Birth</th>
            <th scope="col" class="py-3 px-6">Email</th>
            <th scope="col" class="py-3 px-6">Job</th>
            <th scope="col" class="py-3 px-6">Country</th>
            <th scope="col" class="py-3 px-6">Action</th>
          </tr>
        </thead>
        <tbody>
          <tr v-for="user in users" :key="user.id">
            <td>{{ user.id }}</td>
            <td>
              <img class="inline-block h-6 w-6 rounded-full ring-2 ring-white" :src="user.profile_picture" alt="Profile Picture">
              {{ user.first_name }} {{ user.last_name }}
            </td>
            <td>{{ user.date_of_birth }}</td>
            <td>{{ user.email }}</td>
            <td>{{ user.job }}</td>
            <td>{{ user.country }}</td>
            <td>
              <button type="button" @click="showUserInfo(user)" class="inline-flex items-center rounded-md bg-gray-50 px-2 py-1 text-xs font-medium text-gray-600 ring-1 ring-inset ring-gray-500/10">Select</button>
              <button type="button" @click="showPopup(user)" class="inline-flex items-center rounded-md bg-gray-50 px-2 py-1 text-xs font-medium text-gray-600 ring-1 ring-inset ring-gray-500/10">View Detail</button>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
    <!-- Dialog -->
    <transition name="fade">
      <div v-if="showDialog" class="dialog">
        <div class="dialog-content">
          <button @click="showDialog = false">Close</button>
          <img class="dialog-image" :src="selectedUser.profile_picture" alt="Profile Picture">
          <h2 class="text-2xl font-bold">{{ selectedUser.first_name }} {{ selectedUser.last_name }}</h2>
          <p class="text-sm font-semibold leading-6 text-gray-900">Email: {{ selectedUser.email }}</p>
          <p class="text-sm font-semibold leading-6 text-gray-900">Phone: {{ selectedUser.phone }}</p>
          <!-- Tambahkan data tambahan di sini -->
          <p class="text-sm font-semibold leading-6 text-gray-900">Gender: {{ selectedUser.gender }}</p>
          <p class="text-sm font-semibold leading-6 text-gray-900">Date of Birth: {{ selectedUser.date_of_birth }}</p>
          <p class="text-sm font-semibold leading-6 text-gray-900">Job: {{ selectedUser.job }}</p>
          <p class="text-sm font-semibold leading-6 text-gray-900">Country: {{ selectedUser.country }}</p>
          <!-- Dan info tambahan lainnya -->
        </div>
      </div>
    </transition>
     <!-- popup -->
 <div class="popup" v-if="showPopupFlag">
  <div class="popup-content">
    <span class="close-btn" @click="closePopup">&times;</span>
    <div class="popup-info flex min-w-0 gap-x-4">
      <!-- Gambar pengguna -->
      <img class="popup-image" :src="selectedUser.profile_picture" alt="Profile Picture">
      <!-- Informasi pengguna -->
      <div class="min-w-0 flex-auto">
        <h2 class="text-2xl font-bold">{{ selectedUser.first_name }} {{ selectedUser.last_name }}</h2>
        <p class="text-sm font-semibold leading-6 text-gray-900">Email: {{ selectedUser.email }}</p>
        <p class="text-sm font-semibold leading-6 text-gray-900">Phone: {{ selectedUser.phone }}</p>
      </div>
    </div>
    <div class="popup-text">
      <!-- Paragraf tambahan -->
      <p>Gender: {{ selectedUser.gender }}</p>
      <p>Date of Birth: {{ selectedUser.date_of_birth }}</p>
      <p>Job: {{ selectedUser.job }}</p>
      <p>Address: {{ selectedUser.city }} {{ selectedUser.street }} {{ selectedUser.zipcode }}
        {{ selectedUser.state }} {{ selectedUser.country }}</p>
    </div>
  </div>
</div>
  </div>
</template>

<script>
export default {
  data() {
    return {
      users: [],
      showPopupFlag: false,
      showDialog: false,
      selectedUser: {}
    };
  },
  methods: {
    // Metode untuk menampilkan popup dan menetapkan data pengguna yang dipilih
    showPopup(user) {
      this.selectedUser = user;
      this.showPopupFlag = true;
      // Di sini Anda bisa menetapkan data pengguna yang dipilih ke variabel data lain untuk ditampilkan dalam popup
      console.log('User selected:', user);
    },
    // Metode untuk menampilkan dialog dan menetapkan data pengguna yang dipilih
    showUserInfo(user) {
      this.selectedUser = user;
      this.showDialog = true;
      // Di sini Anda bisa menetapkan data pengguna yang dipilih ke variabel data lain untuk ditampilkan dalam dialog
      console.log('User selected:', user);
    },
    // Metode untuk menutup popup
    closePopup() {
      this.showPopupFlag = false;
    }
  },
  mounted() {
    fetch('http://localhost:3000/users')
      .then(res => res.json())
      .then(data => this.users = data)
      .catch(err => console.log(err.message));
  }
}
</script>

<style scoped>
.fade-enter-active,
.fade-leave-active {
  transition: opacity 1s;
}

.fade-enter,
.fade-leave-to

/* .fade-leave-active in <2.1.8 */
  {
  opacity: 0;
}

.dialog {
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background-color: white;
  padding: 20px;
  border: 1px solid black;
  z-index: 999;
}

.popup {
  display: fixed;
  position: fixed;
  z-index: 9999;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  overflow: auto;
  background-color: rgba(0, 0, 0, 0.4);
}

.popup-content {
  background-color: #fefefe;
  margin: 15% auto;
  padding: 20px;
  border: 1px solid #888;
  width: 80%;
}

.close-btn {
  color: #aaa;
  float: right;
  font-size: 28px;
  font-weight: bold;
}

.close-btn:hover,
.close-btn:focus {
  color: black;
  text-decoration: none;
  cursor: pointer;
}

.popup-image {
  width: 100px;
  /* Sesuaikan lebar gambar sesuai kebutuhan */
  height: auto;
  /* Sesuaikan tinggi gambar sesuai kebutuhan */
  margin-right: 20px;
  /* Sesuaikan jarak antara gambar dan teks sesuai kebutuhan */
}
</style>

